import React from 'react';
import logo from './logo.svg';
import './App.css';
// Header Component 
import styled from 'styled-components';
import Header from './components/Header';

// implement flex box for center align of elements vertically
const FlexBox = styled.div`
    display: flex;
    flex-direction: column;
    width: 100%;
    height: 100%;
` 

const SiteBanner = styled.div`
    background: #075b9a;
    padding: 1.25rem;
    color: #fff;
    text-align: center;
`

const Main = styled.div`
    flex-grow: 1;
    display: flex;
    align-items: center;
`

const Bounds = styled.div`
    margin: 0 60px;
    @media (max-width: 48em) { 
        margin: 0 12px;
    }
`

const HeroWrapper = styled.div`
  max-width: 580px;
  text-align: left;
`

const Headline = styled.h1`
  font-size: 50px;
  margin: 0px 0 0px 0;
  padding: 0;
  line-height: 1.1;
  font-weight: 500;
  @media screen and (min-width: 48em) {
    font-size: 68px;
    font-weight: 500;
    letter-spacing: -0.6px;
    line-height: 1.2;
  }
`
const SubHeadline = styled.h1`
  font-size: 30px;
  line-height: 1.1;
  font-weight: 400;
  @media screen and (max-width: 48em) {
    font-size: 25px;
    line-height: 1.3;
  }
`

const Copyright = styled.h4`
  margin-top: 24px;
  color: rgba(61, 65, 68, 0.3);
  font-size: 20px;
  font-weight: 400;
`

function App() {
  return (
    <div className="App">
      <FlexBox>
      <Header /> 
      <SiteBanner>
        Our site is under active construction!
      </SiteBanner>
        <Main>
          <Bounds>
          <HeroWrapper>
            <Headline>Google Developer Group El Paso</Headline>
            <SubHeadline>We are a group of students and industry professionals who love writing code and developing and we strive to share our passion with others!</SubHeadline>  
          </HeroWrapper>
          </Bounds>
          </Main>
          <Bounds>
        <Copyright>Copyright 2019 GDG El Paso</Copyright>
        </Bounds>
      </FlexBox>
    </div>
  );
}

export default App;
